def rebuild_project():
    # 1. צור את התיקייה הראשית
    os.makedirs(BYTE_ME_DIR, exist_ok=True)

    # 2. עבור על כל תיקייה
    for rel_dir, files in structure.items():
        full_dir = os.path.join(BYTE_ME_DIR, rel_dir)
        os.makedirs(full_dir, exist_ok=True)

        for name, b64content in files.items():
            full_path = os.path.join(full_dir, name)
            # 3. תמיד פענוח Base64 ("" → b"")
            data = base64.b64decode(b64content) if b64content else b""
            with open(full_path, "wb") as f:
                f.write(data)

    # 4. ודא שיש __init__.py גם אם היה ריק
    init_py = os.path.join(SRC_PATH, "byte_me", "__init__.py")
    open(init_py, "wb").close()

    # 5. הרץ את הקובץ הראשי
    subprocess.run(
        [sys.executable, "-m", "byte_me.main"],
        cwd=BYTE_ME_DIR,
        env={**os.environ, "PYTHONPATH": SRC_PATH},
        check=True
    )

if __name__ == "__main__":
    rebuild_project()
